<script>
export default {
  mounted() {
    (function () {
      var pres = document.querySelectorAll("#images pre");
      var len = pres.length;
      for (var i = 0; i < pres.length; i = i + 1) {
        pres[i].style.display = "none";
      }
      var a = 0;
      var title_interval = window.setInterval(function () {
        pres[a].style.display = "none";
        pres[(a + 1) % len].style.display = "block";
        a = a + 1;
        if (a >= len) {
          pres[0].style.display = "none";
          pres[len - 1].style.display = "block";
          clearInterval(title_interval);
        }
      }, 40);
    })();
  },
};
</script>

